import React from 'react'
import styles from './Tables.module.css'
import { useDispatch, useSelector } from 'react-redux';
import { selectTables } from '../../../redux/tables-selectors.ts';

const Tables = (props) => {
    const tables = useSelector(selectTables)
    return (
        <>
        {tables && <span>Create your first table!</span>}
        <div className={styles.tables}>
            <ul className={styles.ul}>
            {tables.map((table) => <li className={styles.li}></li>)}
            <li className={styles.li}><button className={styles.button}>+</button></li>
            </ul>
        </div>
        </>
    )
}

export default Tables
